import React from "react";

const AboutUs = () => {
  return (
    <section className="about">
      <div className="container">
        <h2>Bem vindo à HomeCare</h2>
        <p>
          A HomeCare é uma empresa dedicada à personalização dos serviços de
          saúde, garantindo que cada paciente encontre o melhor profissional
          para suas necessidades.
        </p>
      </div>
    </section>
  );
};

export default AboutUs;
